"""Replaces all the db entries for model "Politician"
"""
def insert_politicians_in_db():
  # clear the current datastore
  db.delete(Politician.all())

  # udpate the politicians in db
  for index in range( len(politicians) ):
    # new politician
    politician = Politician(
      name = politicians[index].lower(),
      party = parties[index].lower(),
      state = states[index].lower(),
      constituency = constituencies[index].lower(),
      wiki_link = wiki_links[index]
    )
    politician.put()
  return 'Inserted ' + str(len(politicians)) + ' entries in the database.'

